import { BrowserRouter } from "react-router-dom";
import Home from './Components/Home/Home';

const root = ReactDOM.createRoot(document.getElementById('root'));

const router = createBrowserRouter([
  {
    path: '/',
    element: <Home />,
  },
  {
    path:  '/daily',
    element: <Game />
  }
]);
root.render(
  <React.StrictMode>
  <App>
  </App>
  </React.StrictMode>
);

